import React from 'react';
//import Modal from 'react-dom';
import './App.css';

function App() {

  window.fetch("https://www.reddit.com/api/v1/authorize?client_id=BmIWdmE0hYrM7Q&response_type=code&state=alskdjfhg&redirect_uri=http://localhost:3000&duration=permanent&scope=read+write&raw_json=1",
  {
    method: 'POST',
    redirect: 'follow',
  })
  .then((response) => {
    console.log(response);
    if (!response.ok)
    {
      console.log(response.status);
    }
  })
  .catch(function(err) {
    console.info(err + " url: ");
  });

  return (
    <div className="App">
    </div>
  );
}

export default App;
